const categoriesData = [
  {
    id: 1,
    image: require('../image/cat.png'),
    title: 'cat',
    selected: true,
  },
  {
    id: 2,
    image: require('../image/fish.png'),
    title: 'fish',
    selected: false,
  },
  {
    id: 3,
    image: require('../image/rice.png'),
    title: 'rice',
    selected: false,
  },
  {
    id: 4,
    image: require('../image/rice.png'),
    title: 'dog',
    selected: false,
  },
];

export default categoriesData;
